// Load a font atlas from byte data.
func Load(data []byte, size float64) (*text.Atlas, error) {
	font, err := truetype.Parse(data)
	if err != nil {
		return nil, err
	}

	face := truetype.NewFace(font, &truetype.Options{
		Size:              size,
		GlyphCacheEntries: 1,
	})

	return text.NewAtlas(face, text.ASCII), nil
}

